import React from 'react';
import Card, { CardVariant } from './components/Card';
import UserList from './components/UserList';
import { IUser } from './types/types';

const users: IUser[] = [
  { id: 1, name: "Kostya", email: "aaa@mail.ru", address: { city: "Moscow", street: "Lenina", zipcode: "11111" } },
  { id: 2, name: "Petya", email: "bbb@mail.ru", address: { city: "Moscow", street: "Presnenskaya", zipcode: "22222" } }
  ]

const App = () => {
  return (
    <div>
    <Card 
    onClick={(num) => console.log("click", num)}
    width='200px' 
    height="200px"
    variant={CardVariant.outlined}
    >
    <button>Кнопка</button>
    <div>fefefefe</div>
    </Card>
    <UserList users={users}/>
    </div>
  );
};

export default App;
